import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { 
  Container, Box, Typography, TextField, Button, 
  Checkbox, FormControlLabel, List, ListItem, 
  Divider, Paper, Grid, Alert
} from '@mui/material';
import axios from 'axios';

function CourseList() {
  const navigate = useNavigate();
  const [courses, setCourses] = useState([]);
  const [searchQuery, setSearchQuery] = useState('');
  const [selectedCourses, setSelectedCourses] = useState([]);
  const [error, setError] = useState('');

  // Fetch courses from backend
  useEffect(() => {
    const fetchCourses = async () => {
      try {
        const response = await axios.get('http://127.0.0.1:8000/course_list');
        setCourses(response.data);
      } catch (error) {
        console.error('Error fetching courses:', error);
        setError('Failed to load courses. Please try again.');
      }
    };

    fetchCourses();
  }, []);

  const handleSearchChange = (e) => {
    setSearchQuery(e.target.value);
  };

  const handleCourseToggle = (course) => {
    setSelectedCourses(prev => {
      if (prev.includes(course)) {
        return prev.filter(c => c !== course);
      } else {
        return [...prev, course];
      }
    });
  };

  const handleSubmit = async () => {
    try {
      await axios.post('http://127.0.0.1:8000/courses_completed', { 
        courses: selectedCourses 
      });
      navigate('/chatbot');
    } catch (error) {
      console.error('Error submitting completed courses:', error);
      setError('Failed to submit courses. Please try again.');
    }
  };

  // Filter courses based on search query
  const filteredCourses = searchQuery
    ? courses.filter(course => course.toLowerCase().includes(searchQuery.toLowerCase()))
    : courses;

  return (
    <Container maxWidth="md">
      <Box sx={{ my: 4 }}>
        <Typography variant="h4" component="h1" gutterBottom>
          Select Completed Courses
        </Typography>

        <TextField
          fullWidth
          label="🔍 Search courses"
          value={searchQuery}
          onChange={handleSearchChange}
          margin="normal"
          variant="outlined"
        />

        <Paper sx={{ mt: 3, mb: 3, p: 2, maxHeight: '400px', overflow: 'auto' }}>
          <List>
            {filteredCourses.map((course, index) => (
              <React.Fragment key={course}>
                <ListItem disablePadding>
                  <FormControlLabel
                    control={
                      <Checkbox
                        checked={selectedCourses.includes(course)}
                        onChange={() => handleCourseToggle(course)}
                      />
                    }
                    label={course}
                  />
                </ListItem>
                {index < filteredCourses.length - 1 && <Divider />}
              </React.Fragment>
            ))}
          </List>
        </Paper>

        <Typography variant="h6" gutterBottom>
          Your Selected Courses:
        </Typography>

        {selectedCourses.length > 0 ? (
          <Paper sx={{ p: 2, mb: 3, bgcolor: 'success.light' }}>
            <List>
              {selectedCourses.map(course => (
                <ListItem key={course}>
                  <Typography>{course}</Typography>
                </ListItem>
              ))}
            </List>
          </Paper>
        ) : (
          <Alert severity="info" sx={{ mb: 3 }}>
            No courses selected yet.
          </Alert>
        )}

        {error && (
          <Alert severity="error" sx={{ mb: 3 }}>
            {error}
          </Alert>
        )}

        <Grid container spacing={2}>
          <Grid item xs={6}>
            <Button 
              fullWidth
              variant="outlined" 
              onClick={() => navigate('/user-preferences')}
            >
              Back to User Details
            </Button>
          </Grid>
          <Grid item xs={6}>
            <Button 
              fullWidth
              variant="contained" 
              color="primary"
              onClick={handleSubmit}
            >
              Start Planning
            </Button>
          </Grid>
        </Grid>
      </Box>
    </Container>
  );
}

export default CourseList;
